import React, { Component } from 'react';
import Portal from '../Common/portal'

class DoctorsPortal extends Component {
    render() {
      var data = localStorage.getItem("doctor");
      var data2 = JSON.parse(data);
      var name="";
      //var detials=JSON.parse( data2.data)
      var i = "";
      for (i in data2.data) {
        name=data2.data[i].fname;
        name += " "+data2.data[i].lname;
        console.log(name);
      }
        return (
          <div>
          <Portal 
          PortalName="Doctor Portal"
          SideBarName="Dashboard"
          PersonName={name}
          
          // Heading 01
          mainoption1="Dashboard"
          smalloption1="Get Report"
          smalllink

          showOption2=""
          smalloption2=""

          showOption3=""
          smalloption3=""

          // Heading 02
          mainoption2="Manage Patients"

          showOption4="true"
          smalloption4="Add Patient"

          showOption5="true"
          smalloption5="Delete Patient"

          showOption6="true"
          smalloption6="Patient History"



          // Heading 03
          mainoption3="Account"
         
          showOption7="true"
          smalloption7="Change Account Info"

          showOption8=""
          smalloption8=""
          

          //   Upload Image
          uploadImage="true"

        //   Add Doc
        addpatdoc=""
        addtype="Doctor/Patient"

          
          />
         
         </div>
        );}
 }
                           
export default DoctorsPortal;
